import React from 'react';
import './NewsFeedRightCenter.css';

const NewsFeedRightCenter = () => {
    return (
        <div className="px-3 py-4">
            <img className="img-fluid pb-2" src="http://www.wpkixx.com/html/winku-dark/images/book-icon.png" alt="" />
            <div className="mt-3">
                <h4 className="text-white">CREATE YOUR OWN FAVOURIT PAGE.</h4>
                <p className="text-white mt-3">like them all</p>
                <button className="w-100 border-0 py-2">Start Now!</button>
            </div>
        </div>
    );
};

export default NewsFeedRightCenter;
